function requestAccessorInfo(){let msg={type:"accessorinfo"};sendMessageToParent(msg)}function sendMessageToParent(b){if(!b){return}try{console.log("sendMessageToParent:",b);window.parent.postMessage(JSON.stringify(b),"*")}catch(a){console.log(a)}}function handleRequestMessage(a){if(a&&a.type=="storage"){if(a.API_URL){API_URL=a.API_URL}if(a.BASE_URL){BASE_URL=a.BASE_URL}if(a.API_TOKEN){API_TOKEN=a.API_TOKEN}if(a.accessorinfo){saveAccessorInfo(a.accessorinfo)}console.log("saveAccessorInfo",a.accessorinfo)}}window.onmessage=function(b){console.log("interface: onmessage:",b.data);try{let payload=JSON.parse(b.data);handleRequestMessage(payload)}catch(a){console.log(a)}};